import React from 'react';
import logo from '../../assets/kupenda-logo.png';
import './Toolbar.css';

const Toolbar = () => {
    return(
        <header style={{width: '100%', height: '50px', backgroundColor: 'blue'}}>
            <nav>
                <div></div>
                <div><a href='/'><img style={{maxWidth: "100px", maxHeight: "50px"}} src={{logo}} /></a></div>
                <ul>
                    <li><a href="/">Users</a></li>
                    <li><a href="/">Products</a></li>
                </ul>
            </nav>
        </header>
    )
}

export default Toolbar;
